finity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1230339","type":"CustomJS"},{"attributes":{"fill_color":"#ffffea","line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"1230062","type":"Patch"},{"attributes":{"line_alpha":{"value":0.1},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"1230284","type":"Segment"},{"attributes":{},"id":"1230007","type":"UndoTool"},{"attributes":{"callback":null,"formatters":{"@datetime":"datetime"},"point_policy":"follow_mouse","renderers":[{"id":"1230211"}],"tooltips":[["Date","@datetime{%c}"],["Size","@size{0,0}"],["P/L","@returns_long{+0.[000]%}"]]},"id":"1230219","type":"HoverTool"},{"attributes":{},"id":"1230247","type":"SaveTool"},{"attributes":{},"id":"1230089","type":"AllLabels"},{"attributes":{"source":{"id":"1230020"}},"id":"1230287","type":"CDSView"},{"attributes":{"bottom_units":"screen","coordinates":null,"fil
